import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Car from "./Car";  // Adjust the path to match the actual location of the Car component

export default function CarTable({ cars }) {


  return (
    <div className="container">
      <table className="table table-repsonsive">
        <thead>
          <tr>
            <th>Name</th>
            <th>Model</th>
            <th>Tip</th>
          </tr>
        </thead>
        <tbody>
          {cars.map((car, index) => (
            <Car key={index} car={car} />
          ))}
        </tbody>
      </table>
    </div>
  );
}
